				</div>
				{/* <div className={`btn-group ${HomeStyle.Controllers}`}>
					<Buttons name={"Decrements"} />
					<Buttons name={"Reset"} />
					<Buttons name={"Increment"} />
				</div> */}
			</div>
		</div>
	);
}

export default Home;
